const Avatar = ({ children,backgroundColor,padding,color,borderRadius,fontSize,textAlign, cursor }) => {
    const style ={
      backgroundColor,
      padding: `${px} ${py}`,
      color: color || 'black',
      borderRadius,
      fontSize,
      textAlign: "center",
      cursor: cursor || null,
      textDecoration: "none"
    }
  return (
    <div style={style}>
        { children }
    </div>
  )
}

export default Avatar
